// View Account Details

import React from 'react'
import Header from '../components/ClientUI/Menu/Header';
import MenuItem from '../components/ClientUI/Menu/BasketFunctionality';
import Cart from '../components/ClientUI/Menu/Cart';
import Reciepts from '../components/ClientUI/Menu/Reciepts';
import menuItemDetails from '../components/ClientUI/Menu/MenuItemDetails';
import Login from '../components/ClientUI/Home/Login';


class MenuBackbone extends React.PureComponent {
    render() {
        return (
            <div>
                <div className="background" style={{backgroundSize: '200px',backgroundImage: `url(assets/img/Asset%203.svg)`}}></div>
                {/*Nav*/}
                <Header />
                {/*/Nav*/}


                {/*Body Container*/}
                <div className="container">
                    <div className="row">

                    {/*Menu Cards Container*/}
                    <div className="col-12 col-lg-8 cardsContainer">
                    {/* <div className="row" style={{margin: '0px'}}> */}

                    {/*Menu Card*/}
                    {/* <MenuItem /> */}
                    <MenuItem />
                    {/*/Menu Card*/}
                    {/* </div> */}
                    </div>
                    {/*/Menu Cards Container*/}

                    {/* Cart Container */}
                    {/* <Cart /> */}
                    <Cart />
                    {/* /Cart Container */}

                    {/* Receipts Container */}
                    <Reciepts />
                    {/* /Receipts Container */}
                    </div>
                </div>

                {/* /Body Container */}

                {/*Menu Item Details Modal*/}
                <menuItemDetails />
                {/*/Menu Item Details Modal*/}

                {/*Log In Modal*/}
                <Login />
                {/*/Log In Modal*/}

                {/*Sign Up Modal*/}
                <CreateCAccount />
                {/*/Sign Up Modal*/}

            </div>
        )
    }
}

export default MenuBackbone
